import './App.css';
import {Route,Routes,useLocation} from "react-router-dom";
import MOLogin from './login/MOLogin';
import MORegister from './register/register';
import Header from "./header/header";
import Header2 from './header2/header2';

function App() {

  const pathName = useLocation();
  console.log(pathName);
  const path = pathName.pathname;


  return (
    <div className="App">
      {path === "/register" || path === "/login" || path === "/" ? <Header userName={pathName} /> : <Header2 userName={pathName.state === null ? "" : pathName.state} />}
      <Routes>
        <Route path="/login" element={<MOLogin />}></Route>
        <Route path="/register" element={<MORegister />}></Route>
        {/* <Route path="/walletConnection" element={<WalletConnection />}></Route> */}
      </Routes>
    </div>  
  );
}


export default App;
